INSERT INTO `tribes` VALUES (47,'Your digital learner\'s permit',0,NULL,NULL,'<p>You are not the weakest link! Your <strong>AVATAR</strong> is!</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Very often in <strong>CYBERSECURITY</strong> you will hear that &ldquo;humans are the weakest link&rdquo;. That means you! And while it is true that more than 80% of the <strong>CYBERSECURITY ISSUES</strong> can be traced back to a human element, it&rsquo;s really your &quot;digital me&quot; you need to learn how to secure.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Within this <strong>TRIBE</strong> we offer you the theory you need to understand how to become cybersecure. <strong>SOCRAI</strong> is a safe learning environment and our tribe leaders will also be able to help you, when you need it.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Some key concepts you will learn</p>\r\n\r\n<ol>\r\n<li>The digital world: <strong>DIGITAL</strong> <strong>REVOLUTION</strong>, <strong>WEB</strong>, <strong>BUSINESS</strong> <strong>MODELS</strong>, <strong>PRIVACY</strong> and <strong>CYBERSECURITY</strong></li>\r\n<li>The digital persona: <strong>YOUR</strong> <strong>AVATAR</strong>, <strong>THE</strong> <strong>BAD</strong> <strong>GUYS</strong>, <strong>SERVICE</strong> <strong>PROVIDERS</strong></li>\r\n<li>The digital technology: <strong>DEVICES</strong>, <strong>APPS</strong>, <strong>NETWORK</strong>, <strong>DATA</strong>, <strong>IDENTITY</strong></li>\r\n</ol>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Enjoy your new learning experience and go make your digital me cybersecure!!!</p>'),(48,'Ask me anything!',0,NULL,NULL,'<p>&nbsp;</p>\r\n\r\n<p>In this tribe you can find an answer to any question we have addressed in one of the current tribes (for example &ldquo;How do I use SOCRAI&rdquo; and &ldquo;Your digital learner&rsquo;s permit&rdquo;).</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>If you want to ask a specific question, and SOCRAI doesn&rsquo;t have the answer for you, please go to your <strong>Dashboard</strong>&nbsp;--&gt;&nbsp;<strong>Discussions</strong> --&gt; &ldquo;<strong>Ask me anything</strong>&rdquo; --&gt; &ldquo;<strong>I have another question</strong>&rdquo; and post your question in the comments.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Your friendly TRIBE leader will come back to you! We might even add it to the list of questions, so you help your other Tribe members by being curious!</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Enjoy your new learning experience and go make your digital me cybersecure!!!</p>'),(50,'How do I use SOCRAI?',0,NULL,NULL,'<p>&nbsp;</p>\r\n\r\n<p><strong>SOCRAI</strong> has a mission to help you with cybersecurity. Just like you have a <strong>LEARNER&rsquo;S</strong> <strong>PERMIT</strong> to prove you are entitled to learn how to drive a car, SOCRAI will deliver you a learner&rsquo;s permit<strong> </strong>for the digital world. And with some practice and help from our <strong>TRIBE</strong>, you&rsquo;ll soon be able to earn you driver&rsquo;s<strong> </strong>license for the digital world! The way SOCRAI works is quite simple. You ask a <strong>QUESTION</strong>, we answer it. Sometimes a question will unlock an <strong>EXERCISE</strong>. The goal of an exercise is not to see if you are right or wrong, but if you understand it. An exercise can be unlocked only once!</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>To help you, you will get a <strong>CLUE</strong> to get you started. A clue is a word that we&rsquo;ll give you, or that you can find in an answer . It&rsquo;s typically in <strong>CAPITAL LETTERS</strong>. Examples of a clue in this text are, <strong>SOCRAI</strong>,&nbsp;<strong>LEARNER&rsquo;S</strong> <strong>PERMIT</strong>, <strong>TRIBE</strong>, <strong>QUESTION</strong>, <strong>EXERCISE, </strong><strong>CLUE</strong> and even <strong>CAPITAL LETTERS</strong>.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>If you have a specific question, you can go to the tribe &ldquo;Ask me anything!&rdquo; and ask the question there. If SOCRAI has no answer for you, you can post it under Discussions in your Dashboard and your friendly Tribe leader will come back to you. We might even add it to the list of questions, so you help your other Tribe members by being curious! If SOCRAI is not working as expected or you are encountering problems, please go to your Dashboard --&gt;&nbsp;Discussions --&gt; &ldquo;How do I use SOCRAI&rdquo; --&gt; &ldquo;Can I ask you something&rdquo; and post your question. Your friendly Tribe leader will come back to you and answer whatever question you might have or fix whatever problem you might encounter.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Let&#39;s give it a try (<strong>click below</strong>) and ask us a question on one of the seven clues! Enjoy your new learning experience and go make your digital me cybersecure!!!</p>\r\n\r\n<p>&nbsp;</p>'),(51,'Ertugral Ghazi',413,NULL,NULL,'<p>This is Islamic related drama to motivate the Muslims&nbsp;</p>'),(52,'Check DATA tRIBE',416,NULL,NULL,'<p>This tribe to chreck the data</p>'),(53,'New Tribe',405,NULL,NULL,'<p>asjibfasdbhfas djas fjsd nfiwj fgaw ru8wri fberyrb ufer8u berf brh bevhbw ufbwer fuyrb</p>'),(55,'Testing Tribes',0,NULL,NULL,'<p>asdasdasdsadnas d asdas</p>');
